import {SAVE_COLOR} from '../type';
import {SAVE_NAME} from '../type';

const initialState = {
    data:{
        tile:[]
    ,
    name:''}
}

export default function(state=initialState,action) {
    switch (action.type) {
        case SAVE_COLOR:

        return {
                ...state,
                tile:action.payload

            }
        case SAVE_NAME:
        return {
            ...state,
            name:action.payload
        }
        default:
            return state;
    }
}
